  const data = useSelector((state) => state);
  console.log("isLogedin", data);
  // console.log("useInfo", state);
  return (
    <Route
      {...rest}
      render={(props) =>
        1 ? <Redirect to="/home" /> : <Component {...props} />
      }
    />
